import React from 'react';
import './App.css';
import Header from './Header';
import Login from './Login';


function App() {
  return (
    <div className="App">
      <div className="App_header">
        <Header />

      </div>

      <div className="App__login">
        <Login />
        <div className="App_input">
            <input type="submit" value="submit" />
            <input type="submit" value="submit" />
        </div>
      </div>
    </div>
  );
}

export default App;
